			},
			create(){

				game.scale.refresh();
				this.dark = game.add.graphics();
		        this.dark.beginFill(0xffffff, 1);
		        this.dark.drawRect(0, 0, game.width, game.height);
				var logoABI =  game.add.sprite(game.width / 2, game.height / 2, 'logoABI');
				var ratioLogo = logoABI.width/(game.width/2);
				logoABI.anchor.setTo(0.5);
				logoABI.scale.setTo(1/ratioLogo);
				var tween = game.add.tween(logoABI).to({alpha:0},1500);
				 tween.start();
				tween.onComplete.add(function(){
							
							game.state.start("gameplay");
							
						}, this);
			},
			update(){

			}
		}


		var gameplay = {
			preload(){

			},
			create(){
				//sky
				game.physics.startSystem(Phaser.Physics.BOX2D);
				game.physics.box2d.debugDraw.joints = true;
				game.physics.box2d.debugDraw.shapes = true;
				 game.physics.box2d.gravity.y = 700;
				game.world.setBounds(0, 0, 10000, game.height);
				sky = game.add.sprite(game.width/2,game.height/2,"sky");
				var skyRatio = sky.width/game.width;
				sky.anchor.setTo(0.5);
				sky.scale.setTo(1/skyRatio);
				sky.height = game.height;
				//buidng middle
				for(var i =0;i<10;i++){
					var buiding_middle =game.add.sprite(0,game.height/2,"buiding_middle");
					var buidingRatio = buiding_middle.width/(5*game.width);
					buiding_middle.anchor.setTo(0,0);
					buiding_middle.scale.setTo(1/buidingRatio);
					buiding_middle.reset(i*buiding_middle.width,game.height/3);
				}
				//buding bottom
				for(var i=0;i<10;i++){
					var buiding_bottom =game.add.sprite(0,game.height,"buiding_bottom");
					var buidingRatio = buiding_bottom.width/(2*game.width);
					buiding_bottom.anchor.setTo(0,0.5);
					buiding_bottom.scale.setTo(1/buidingRatio);
					buiding_bottom.reset(i*buiding_bottom.width,game.height);
				}
				var paddle = game.add.sprite(game.width/2,game.height/2,"paddle");
				var paddleRatio = paddle.width/(3*game.width/5);
				paddle.anchor.setTo(0,0.5);
				paddle.scale.setTo(1/paddleRatio);
				// paddle.reset(-paddle.width/2,2*game.height/3);

				player = game.add.sprite(game.width/5, game.height * 0.5,"player");
		        player.animations.add('idle', [3], 0, true);
		        player.animations.add('jump', [1], 0, true);
		        player.animations.add('die', [0], 0, true);
		        player.animations.add('down', [2], 0, true);
		        player.animations.play('idle');
		        var playerRatio = player.width/(game.width/8);
		        player.anchor.setTo(0,0.5);
				player.scale.setTo(1/playerRatio);
				game.physics.box2d.enable(player);
				 player.body.setRectangle(player.width,player.height, 0, -player.height/10);


				game.physics.box2d.enable(paddle);
		        paddle.body.static = true;
		        paddle.body.setRectangle(paddle.width,paddle.height, 0, 0);
		        paddle.reset(0,2*game.height/3);


			},
			update(){

			},
			 render: function() {
				game.debug.box2dWorld();
			}
		}
	
		function createAsprite(x,y,src,anc,scl){
				var sprite =  game.add.sprite(x,y,src);
				sprite.anchor.setTo(anc);
				sprite.scale.setTo(scl);
				return sprite;
			}

		game.state.add("boot",boot);
		game.state.start("boot");
		game.state.add("gameplay",gameplay);







	</script>
